$("document").ready(function(){var a=new Date,l=a.getMonth()+1,e=a.getDate(),i=(e<10?"0":"")+e+"/"+(l<10?"0":"")+l+"/"+a.getFullYear();$("#Fecha").val(i)}),$(".calculo").change(function(){if(""!=$("#lec_final").val()&&""!=$("#lec_inicial").val()){var a=3.78541*($("#lec_final").val()-$("#lec_inicial").val());if($("#c_agua").val(Math.round(100*a)/100),""!=$("#biosol").val()){var l=a/$("#biosol").val()*1e3;$("#ratio").val(Math.round(100*l)/100)}}});